        lowest = start
        for i in range(1, len(nums)):
            if nums[i] < start:
                lowest = start
                start = nums[i]
            elif nums[i] < start:
                start = nums[i]
        return lowest

    result = 0
    for i in range(n):
        if i == 0:
            result = solve(nums[i:])
        else:
            result += solve(nums[i:i+1])
    return result

