    def convert(str):
        new_str = []
        for i in range(len(str)):
            if str[i]!= '0':
                new_str.append(str[i])
            else:
                new_str.append('1')
        return "".join(new_str)

    def build_tree(left, right):
        if left >= right:
            return None
        p = int(left / 2)
        left_str = convert(str[:p]) + "0" + convert(str[p:])
        right_str = convert(str[p:]) + "1" + convert(str[:p])
        tree = {
            "left": build_tree(left, p),
            "right": build_tree(p, right),
            "children": [left_str, right_str]
        }
        return tree

    def dfs(left, right, tree):
        if left >= right:
            return tree
        p = int(left / 2)
        left_str = dfs(left, p, tree["children"][0])
        right_str = dfs(p, right, tree["children"][1])
        tree["children"][0] = left_str
        tree["children"][1] = right_str
        return tree

    return dfs(0, len(stdin), build_tree(0, len(stdin)))


